export default (function(a,b,c,d,e,f,g){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:f,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:b,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:b,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:b,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:f,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:g,pageSize:25,pageCount:g,total:5}}},"1U6YhWvXf1":{data:{id:649,attributes:{imdbId:"tt1179031",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BMTc4NTU4MTY2Nl5BMl5BanBnXkFtZTgwNDM5MjQ2MTE@._V1_SX300.jpg",type:b,ratings:[{Source:"Internet Movie Database",Value:"6.8\u002F10"},{Source:"Rotten Tomatoes",Value:"84%"},{Source:"Metacritic",Value:"73\u002F100"}],item_lang:{data:{id:1312,attributes:{title:e,plot:"A terrified man Richard (Michael Hall) accidentally shoots a burglar inside his house. He is assured by the cop (Nick Damici) that it was purely self defense n the burglar was a wanted fella. Richard shaken by the experience n not proud by the incident, visits the cemetery on the burglar's burial day n gets confronted by Ben, a paroled convict n the dead burglar's dad. Ben indirectly threatens and praises Richard's family pic which he saw in the newspaper. The cops cant arrest Ben as he hasn't done anything n cant give Richard official police protection..",slug:"cold-in-july"}}},books:{data:[{id:4404,attributes:{title:e,description:"Richard Dane, a small businessman, kills a man in self-defense. Ben Russell, the ex-con father of the deceased, vows revenge and plans to avenge the life of his son with the life of Dane's son.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=XFrVwAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[c],firstBook:true,published:"2014-05-27",publisher:a,subtitle:a}},{id:4405,attributes:{title:e,description:a,thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=rkduh4URrJ4C&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[c],firstBook:d,published:"2011-07-20",publisher:"Gere Donovan Press",subtitle:a}},{id:4406,attributes:{title:"The Best of Joe R. Lansdale",description:"Godzilla’s in a twelve-step program. A soul-sucking Mummy stalks Elvis and John F. Kennedy. Joe Bob Briggs has a moral dilemma: If your girlfriend turns zombie on you, what do you do? And that’s the tame stuff. In this red-hot collection from world-champion Mojo storyteller Joe R. Lansdale, you’ll find his best, most outrageous stories. The high priest of Texan weirdness does it all: horror, mystery, satire, suspense, and even Westerns. Prepare to be offended, shocked, and cackling like a crazed redneck. Featuring five Bram Stoker Award–winning stories, this career retrospective contains some of Lansdale’s rarer work, his nonfiction forays into drive-in theaters and B-movies, and the novella Bubba Ho-Tep, later made into a cult-classic major motion picture. Come on in—the weirdness is fine.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=ch3cAwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:["Joe R Lansdale"],firstBook:d,published:"2010-02-01",publisher:"Tachyon Publications",subtitle:a}},{id:4407,attributes:{title:"Red Range: A Wild Western Adventure",description:"Set during the 19th century, and combining an unusual mix of racial unrest, odd ball characters, and strange happenings, Red Range is a unique take on “The Western.” During a Klan lynching, a mysterious rider appears, and proves to be a deadly shot! It is the Red Mask, a tough, lethal, black man who wisely keeps his identity concealed, especially while battling his enemies. Through a series of events, the Red Mask continues to thwart the violent and hateful actions of the Klan, while picking up an orphan along the way, and teaching him how to turn his hate into something more positive.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=TE4rDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[c],firstBook:d,published:"2017-07-19",publisher:"IDW Publishing",subtitle:a}},{id:4408,attributes:{title:"The Bottoms",description:"The Edgar Award winning thriller The Bottoms is classic American storytelling in its truest, darkest, and more affecting formwith echoes of William Faulkner and Harper Lee. Its 1933 in East Texas and the Depression lingers in the air like a slow moving storm. When a young Harry Collins and his little sister stumble across the body of a black woman who has been savagely mutilated and left to die in the bottoms of the Sabine River, their small town is instantly charged with tension. When a second body turns up, this time of a white woman, there is little Harry can do from stopping his Klan neighbors from lynching an innocent black man. Together with his younger sister, Harry sets out to discover who the real killer is, and to do so they will search for a truth that resides far deeper than any river or skin color.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=E8AD1AnCVZoC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[c],firstBook:d,published:"2010-12-07",publisher:"Vintage Crime\u002FBlack Lizard",subtitle:a}}]}}},meta:{}}},prerenderedAt:1681309164738}}("","movie","Joe R. Lansdale",null,"Cold in July","series",1))